import React from "react";

import { connect } from "react-redux";

import { CardContainer, Image } from "./carousel-card.styles";

const CarouselCard = ({ item, collection }) => {
  console.log("keyyyy", item);
  console.log("3X", collection[item]);
  return (
    <CardContainer className="carousel__card">
      {/* <Image src={collection[item].imageUrl} alt="" /> */}
      {collection[item].items.map((image) => {
        <Image src={image.imageUrl} />;
      })}
    </CardContainer>
  );
};

const mapStateToProps = (state) => ({
  collection: state.product.collections,
});

export default connect(mapStateToProps)(CarouselCard);
